    <>
      <div className="cont-fluid w-100">
        {/* <p className="txt-xl txt-700">Welcome to Pet Smart!</p> */}
        <p className="txt-xl mg-tb-1">ALL YOUR PET NEEDS, IN ONE PLACE!</p>
